                  <h3 class="pt-1 font-weight-bold ">IIFA Awards 2020 - Popular Award Winners</h3>
                <!--  <div class="blog-details pt-2 pl-0 m-0">
                    <span class="font-weight-bold " style="font-size:1em;">Created By Admin At <h6> 26 th November 2021 </h6> </span>

                  </div> -->
                  <p class="archive-text pb-3 "><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">The IIFA Awards make for a stellar evening every year when the stars that grace our screens give us incredible performances on stage and are recognised for their hard work. Unfortunately, the 2020 IIFA Awards was an unavoidable exception due to the global pandemic and we missed seeing our stars on the red carpet. However, the one factor that remained consistent was honouring them for their exceptional work. </span></p><p><b style="font-weight:normal;" id="docs-internal-guid-603f0adf-7fff-3a1e-bcc7-e34c1c5da4c4"><br></b></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Let’s see which of our favourite stars took the coveted IIFA Award home and which films took the jury’s hearts away. </span></p><p><b style="font-weight:normal;"><br></b></p><ol style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type:decimal;font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;" aria-level="1"><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">The Kabir Singh team took home four awards. These were for Best Picture received by the makers Bhushan Kumar, Krishan Kumar, Murad Khetani, Ashwin Varde, Performance In A Leading Role (Male) to Shahid Kapoor, Music Direction to Akhil Sachdeva, Vishal Mishra, Sachet - Parampara, Amaal Mallik, Mithoon, and Playback Singer (Female) to Shreya Ghoshal.</span></p></li></ol><p><img src="data:image/png;base64," style="width: 500px;" data-filename="Best Picture.png"><b style="font-weight:normal;"><br></b></p><p><img src="data:image/png;base64," style="width: 500px;" data-filename="music director.png"><b style="font-weight:normal;"><br></b></p><p><img src="data:image/png;base64," style="width: 500px;" data-filename="Shreya.png"><b style="font-weight:normal;"><br></b></p><ol style="margin-top:0;margin-bottom:0;padding-inline-start:48px;" start="2"><li dir="ltr" style="list-style-type:decimal;font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;" aria-level="1"><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Gully Boy was second in line with three awards for Performance In A Leading Role (Female) to Alia Bhatt, Performance In A Supporting Role (Male) to Siddhant Chaturvedi and, Best Story to Reema Kagti and Zoya Akhtar. </span></p></li></ol><p><img src="data:image/png;base64," style="width: 500px;" data-filename="Best Actress.png"><b style="font-weight:normal;"><br></b></p><p><img src="data:image/png;base64," style="width: 500px;" data-filename="Best story.png"><b style="font-weight:normal;"><br></b></p><ol style="margin-top:0;margin-bottom:0;padding-inline-start:48px;" start="3"><li dir="ltr" style="list-style-type:decimal;font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;" aria-level="1"><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Uri’s director Aditya Dhar won the award for best direction for making the film a masterpiece. </span></p></li></ol><p><img src="data:image/png;base64," style="width: 500px;" data-filename="Best Director.png"><b style="font-weight:normal;"><br></b></p><ol style="margin-top:0;margin-bottom:0;padding-inline-start:48px;" start="4"><li dir="ltr" style="list-style-type:decimal;font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;" aria-level="1"><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Kiara Advani won the award for Performance In A Supporting Role (Female) for Good Newwz. </span></p></li></ol><p><img src="data:image/png;base64," style="width: 500px;" data-filename="Supporting actress.png"><b style="font-weight:normal;"><br></b></p><ol style="margin-top:0;margin-bottom:0;padding-inline-start:48px;" start="5"><li dir="ltr" style="list-style-type:decimal;font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;" aria-level="1"><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Arijit Singh bagged another award for his magical voice in War in the Playback Singer (Male) category for singing the foot-tapping Ghungroo. </span></p></li></ol><p><img src="data:image/png;base64," style="width: 500px;" data-filename="Best singer.png"><b style="font-weight:normal;"><br></b></p><ol style="margin-top:0;margin-bottom:0;padding-inline-start:48px;" start="6"><li dir="ltr" style="list-style-type:decimal;font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;" aria-level="1"><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">The award for the best Lyrics went to Manoj Muntashir for the song Teri Mitti in Kesari. </span></p></li></ol><p><img src="data:image/png;base64," style="width: 500px;" data-filename="Best lyrics.png"><b style="font-weight:normal;"><br></b></p><ol style="margin-top:0;margin-bottom:0;padding-inline-start:48px;" start="7"><li dir="ltr" style="list-style-type:decimal;font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;" aria-level="1"><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">The year 2020 also saw some new talent. Abhimanyu Dasani bagged the award for the Best Debut Male for Mard Ko Dard Nahi Hota. Ananya Pandey was the choice for best Debut Female for Student Of The Year 2. </span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;" role="presentation"><img src="data:image/png;base64," style="width: 500px;" data-filename="Debut stars.png"><span style="font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"><br></span></p></li></ol><p><br></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:12pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Congratulations to all the stars and a big thank you for continuing to entertain us even in bleak times!</span></p>                </div>
